Tests
L'écriture des tests unitaires s'appuie sur Junit4
L'écriture des scénarios de test des ressources REST s'appuie sur Rest Assured
Les tests de conversions de formats (transformations XSLT) s'appuient sur l'utilisation de XmlUnit.
NB L'exécution des tests REST suppose que l'application soit en cours d'exécution et joignable à l'URL http://localhost:8080/rmspogfo/
Lancer les tests

Pour lancer les tests unitaires exécuter la commande:

mvn test


Pour lancer les tests d'intégration exécuter la commande:

mvn integration-test

Configuration de Rest Assured
Avant l'exécution d'un scenario de test, un appelle à la méthode statique configure de la classe RestAssuredConfig permet de:

Définir l'url d'appel de nos services
Obtenir un id de session correspondant à un utilisateur authentifié sur l'application

Le fichier RestAssuredConfig.java
package fr.insee.pogues.rest.utils;

import com.jayway.restassured.RestAssured;
import org.apache.logging.log4j.LogManager;
import org.apache.logging.log4j.Logger;

import static com.jayway.restassured.RestAssured.expect;

/**
 * Created by acordier on 06/07/17.
 */
public class RestAssuredConfig {

    private static Logger logger = LogManager.getLogger(RestAssuredConfig.class);

    public static String jUsername = "D5WQNO";
    public static String jPassword = "D5WQNO";
    public static String jUserPermission = "DG75-L120";


    public static void configure() {
        configure(jUsername, jPassword);
    }

    public static void configure(String username, String password) {
        RestAssured.baseURI = "http://localhost:8080/rmspogfo";
        /* All this boilerplate thing to handle Form auth with tomcat */
        String sessionId;
        sessionId = expect()
                .statusCode(200)
                .log().all()
                .when()
                .get("/notfound")
                .sessionId();
        sessionId = expect().statusCode(302)
                .log().all()
                .given()
                .param("username", username)
                .param("password", password).cookie("JSESSIONID", sessionId)
                .post("/login")
                .sessionId();
        expect()
                .statusCode(404)
                .log().all()
                .given().cookie("JSESSIONID", sessionId)
                .when()
                .get("/notfound");
        RestAssured.sessionId = sessionId;
    }


}

