Permissions
Les règles d'usage pour le contrôle des permissions sont:

Uniquement sur les opérations de mise à jour (PUT sur le endpoint /persistence/questionnaires/{id})
Les permissions sont vérifiées à l'aide de l'attribut 'permission' de l'utilisateur connecté.

Les attributs d'un utilisateur sont indiqués par le constructeur de la classe User:
    public User(
            String id,
            String name,
            String firstName,
            String lastName,
            String permission
    ) {
        this.id = id;
        this.name = name;
        this.permission = permission;
        this.firstName = firstName;
        this.lastName = lastName;
    }

Le contrôle d'accès s'effectue au moyen d'un filtre jersey définit dans le fichier OwnerRestrictedFilter.java. 
Il est activé en ajoutant l'annotation @OwnerRestricted sur une ressource attendant une payload correspondant à un questionnaire.
Le fichier de test décrivant le comportement de ce filtre est le suivant:
package fr.insee.pogues.jersey;

import fr.insee.pogues.persistence.service.QuestionnairesService;
import fr.insee.pogues.user.model.User;
import fr.insee.pogues.user.query.UserServiceQuery;
import fr.insee.pogues.webservice.rest.OwnerRestrictedFilter;
import fr.insee.pogues.webservice.rest.PoguesException;
import org.glassfish.jersey.server.ContainerRequest;
import org.glassfish.jersey.server.ExtendedUriInfo;
import org.json.simple.JSONObject;
import org.junit.Before;
import org.junit.Rule;
import org.junit.Test;
import org.junit.rules.ExpectedException;
import org.mockito.InjectMocks;
import org.mockito.Mock;

import javax.ws.rs.core.MultivaluedMap;
import javax.ws.rs.core.SecurityContext;
import java.security.Principal;

import static org.junit.Assert.assertEquals;
import static org.mockito.Mockito.*;
import static org.mockito.MockitoAnnotations.initMocks;

public class TestOwnerRestrictedFilter {

    @Mock
    QuestionnairesService questionnaireService;

    @Mock
    UserServiceQuery userServiceQuery;

    @InjectMocks
    OwnerRestrictedFilter filter;

    @Rule
    public ExpectedException exception = ExpectedException.none();

    @Before
    public void setUp(){
        filter = spy(new OwnerRestrictedFilter());
        initMocks(this);
    }

    @Test // No payload attached =>  400|Bad Request
    public void filterWithNullIdException() throws Exception {
        exception.expectMessage("Bad Request");
        exception.expect(PoguesException.class);
        try {
            filter(null);
        } catch(Exception e) {
            String detailedMessage = ((PoguesException)e).toRestMessage().getDetails();
            assertEquals("No id path param found to perform authorization", detailedMessage);
            throw e;
        }
    }


    @Test
    public void filterWithUnauthorizedException() throws Exception {
        exception.expectMessage("Unauthorized");
        exception.expect(PoguesException.class);
        try {
            JSONObject payload = new JSONObject();
            String id = "ENTITY-ID";
            payload.put("id", id);
            payload.put("owner", "A-USER-GROUP");
            ContainerRequest crc = mock(ContainerRequest.class);
            ExtendedUriInfo uriInfo = mock(ExtendedUriInfo.class);
            MultivaluedMap pathParams = mock(MultivaluedMap.class);
            when(pathParams.getFirst("id")).thenReturn(id);
            when(uriInfo.getPathParameters()).thenReturn(pathParams);
            when(crc.getUriInfo())
                    .thenReturn(uriInfo);
            when(crc.getSecurityContext()).thenReturn(new SecurityContext() {
                @Override
                public Principal getUserPrincipal() {
                    return /* principal name */() -> "CURRENT-USER-ID";
                }

                @Override
                public boolean isUserInRole(String s) {
                    return false;
                }

                @Override
                public boolean isSecure() {
                    return false;
                }

                @Override
                public String getAuthenticationScheme() {
                    return null;
                }
            });
            JSONObject storedEntity = new JSONObject();
            storedEntity.put("owner", "ANOTHER-GROUP");
            when(questionnaireService.getQuestionnaireByID(id))
                    .thenReturn(storedEntity);
            when(userServiceQuery.getNameAndPermissionByID("CURRENT-USER-ID"))
                    .thenReturn(new User("CURRENT-USER-ID",
                            "John Doe",
                            "John",
                            "Doe",
                            "NON-MATCHING-GROUP"));
            filter.filter(crc);
        } catch(Exception e) {
            String detailedMessage = ((PoguesException)e).toRestMessage().getDetails();
            int status = ((PoguesException)e).toRestMessage().getStatus();
            assertEquals("This object is not yours", detailedMessage);
            assertEquals(403, status);
            throw e;
        }
    }

    @Test
    public void filterWithUnauthenticatedException() throws Exception {
        exception.expectMessage("Unauthenticated");
        exception.expect(PoguesException.class);
        try {
            JSONObject payload = new JSONObject();
            String id = "ENTITY-ID";
            payload.put("id", id);
            payload.put("owner", "A-USER-GROUP");
            ContainerRequest crc = mock(ContainerRequest.class);
            ExtendedUriInfo uriInfo = mock(ExtendedUriInfo.class);
            MultivaluedMap pathParams = mock(MultivaluedMap.class);
            when(pathParams.getFirst("id")).thenReturn(id);
            when(uriInfo.getPathParameters()).thenReturn(pathParams);
            when(crc.getUriInfo())
                    .thenReturn(uriInfo);
            when(crc.getSecurityContext()).thenReturn(new SecurityContext() {
                @Override
                public Principal getUserPrincipal() {
                    return null;
                }

                @Override
                public boolean isUserInRole(String s) {
                    return false;
                }

                @Override
                public boolean isSecure() {
                    return false;
                }

                @Override
                public String getAuthenticationScheme() {
                    return null;
                }
            });
            when(questionnaireService.getQuestionnaireByID("ENTITY-ID"))
                    .thenReturn(payload);
            filter.filter(crc);
        } catch(Exception e) {
            String detailedMessage = ((PoguesException)e).toRestMessage().getDetails();
            int status = ((PoguesException)e).toRestMessage().getStatus();
            assertEquals("You are not logged in", detailedMessage);
            assertEquals(401, status);
            throw e;
        }
    }

    private void filter(String id) throws Exception  {
        ContainerRequest crc = mock(ContainerRequest.class);
        ExtendedUriInfo uriInfo = mock(ExtendedUriInfo.class);
        MultivaluedMap pathParams = mock(MultivaluedMap.class);
        when(pathParams.getFirst("id")).thenReturn(id);
        when(uriInfo.getPathParameters()).thenReturn(pathParams);
        when(crc.getUriInfo())
                .thenReturn(uriInfo);
        filter.filter(crc);
    }


}

conversions/.body:
Conversion de formats
Le passage d'un format de meta donnée à un autre est une fonctionalité clef de l'application Pogues. Ces transformations peuvent être réalisées au moyen d'appels à des services externes, de transformations XSLT ou de n'importe quel autre moyen susceptible d'apparaître au gré des besoins. Ces transformations peuvent être chaînées tout comme elles peuvent être appliquées de façon unitaire.
Toutes les implementations utilisées pour mener à bien ces transformations s'appuient donc sur une interface commune afin de faciliter la mise en place de chaînes de transformations répondant aux cas d'usages imposés par les spécifications. 
L'interface Transformer
En conséquence toute implémentation de transformation DOIT implémenter l'interface Transformer dont le contrat définit un certain nombre de méthodes  transform s'appliquant à différents types d'entrées/sorties 
package fr.insee.pogues.transforms;

import java.io.InputStream;
import java.io.OutputStream;
import java.util.Map;

public interface Transformer {
    void transform(InputStream input, OutputStream output, Map params) throws Exception;
    String transform(InputStream input, Map params) throws Exception;
    String transform(String input, Map params) throws Exception;

}

Une table de paramètre passée en argument permet aux transformers  de s'appuyer sur de la configuratione externe pour produire leur sortie.
L'interface fonctionnelle transform
Pour nous permettre d'utiliser les méthodes de l'interface Transform en s'appuyant sur les références de méthodes de Java 8, une interface fonctionnelle Transform est définie, à laquelle se conforment toutes les méthodes de l'interface Transformer:
    @FunctionalInterface
    public interface Transform {
        O apply(I i, Map params) throws Exception;
    }

La classe Pipeline
La classe Pipeline nous permet de chaîner nos méthodes de transformation pour élaborer des scenarios de transformation complexes
Par exemple la visualisation d'un questionnaire dans l'application est réalisée au moyen de la chaîne de transformation suivante:
[Pogues JSON] -> [Pogues XML] -> [DDI] -> [XForm] -> [Form URI]
Voici un example de code représentant une chaîne de transformation:
class PipeSample{
    public String pipe(HttpServletRequest request){
        return pipeline
            .from(request.getInputStream())
            .map(jsonToXML::transform, params)
            .map(xmlToDDI::transform, params)
            .map(ddiToXForm::transform, params)
            .map(xformToUri::transform, params)
            .transform()
            .getBytes();
    }
}

Dans cette version les chaînes de transformation s'appuient sur des entrées/sorties de type String, à l'exception du point d'entrée fournit sous forme de Stream ou de String. 
La réalisation de la chaine de transformation s'effectue en fournissant une entrée à la chaîne au moyen de la méthode from de la classe PipeLine.
Nous pouvons ensuite chaîner nos différentes étapes de transformation en utilisant la méthode map de la classe PipeLine. Les méthodes from et map retournent l'instance de la classe PipeLine, permettant une écriture fluide de la chaîne de transformation.
La transformation est rélisée uniquement à l'appe de la methode transform() sur l'instance de la classe PipeLine
